import React from 'react';
import Loader from 'react-dots-loader'
import 'react-dots-loader/index.css'

const Loading = () => {

    return (
        <div>
            <h1>Loading</h1>

            <Loader />

            <Loader visible={false} />

            <Loader size={10} />

            <Loader distance={30} />
        </div>

    )
}

export default Loading;
